Example_1:
input: [0, 7, 7, 7, 0, 9, 0, 0, 0, 0, 0, 0, 0, 0]
output: [0, 0, 0, 0, 0, 9, 0, 7, 7, 7, 0, 0, 0, 0]

Example_2:
